def bin2hex(binstr):
    return hex(int (binstr,2))


def bin2char(binstr):
    h = 2**3
    sum = 0
    for i in binstr:
        sum += (ord(i)-ord('0'))*h
        h //= 2
    if (sum < 10):
        return str(sum)
    elif (sum == 10):
        return 'A'
    elif  (sum == 11):
        return 'B'
    elif (sum == 12):
        return 'C'
    elif (sum == 13):
        return 'D'
    elif (sum == 14):
        return 'E'
    elif (sum ==15):
        return 'F'



